import react from '../images/react.png';
import python from '../images/python.png';
import js from '../images/js.png';
import tensorflow from '../images/tensorflow.png';
import pytorch from '../images/pytorch.png';
import hf from '../images/hf.png';
import cirrus from '../images/cirrus.png';

import DividerComponent from "./DividerComponent";

export default function TechComponent(props) {

    const div = <DividerComponent name="Technologies"/>;

    return (
        <div className="tech-component" ref={props.myref}>
            {div}
            <div className="tech-packet">
                <div className="tech-image">
                    <a href='https://www.python.org'><img src={python} alt='python'/></a>
                </div>
                <div className="tech-image">
                    <a href='https://pytorch.org'><img src={pytorch} alt='pytorch'/></a>
                </div>
                <div className="tech-image">
                    <a href='https://huggingface.co'><img src={hf} alt='huggingface'/></a>
                </div>
                <div className="tech-image">
                    <a href='https://www.tensorflow.org'><img src={tensorflow} alt='tensorflow'/></a>
                </div>
                <div className="tech-image">
                    <a href='https://www.javascript.com'><img src={js} alt='javascript'/></a>
                </div>
                <div className="tech-image">
                    <a href='https://react.dev'><img src={react} alt='react'/></a>
                </div>
                <div className="tech-image">
                    <a href='https://cirrus-ui.netlify.app'><img src={cirrus} alt='cirrus'/></a>
                </div>
            </div>
        </div>
    );
}
